//imports
import React from 'react';
import '../App.css';
import Movies from './Movies';
import axios from 'axios';

//class
class Read extends React.Component {
    state = {
        movies: []
    };

    //call for movie cards
    componentDidMount() {
        axios.get('https://jsonblob.com/api/jsonblob/090d3cd5-e03d-11e9-a2ce-89c479f14772')
            .then((response) => {

                this.setState({ movies: response.data.Search })//search for the movies


            })
            .catch((error) => {
                console.log(error);//incase of error


            });
    }

    render() {
        return (
            <div className="App">
                <h1>Read Component</h1>
                <Movies movies={this.state.movies}></Movies>
            </div>
        );
    }
}
